import logo from "../img/logo2.png";
import sun from "../img/weather-icons/sun.png";
import "../App.css";
import React from "react";
import { Link } from "react-router-dom";

function Contact() {
  let exampleCity = (tab) => {
    //wykonuje zapytanie do api w funkcji
    return (
      <div id="exampleCity">
        {tab.map((item, index) => (
          <div key={index} className="App-panel2">
            <h3>{item}</h3>
            <div className="App-degree">
              <p>25&deg;C</p>
            </div>
            <div>
              <img src={sun} alt="sun" className="App-icon" />
            </div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <section>
    </section>
  );
}

export default Contact;
